import ripple from '../assets/avatars/ripple.png';
import litecoin from '../assets/avatars/litecoin.png';
import cardano from '../assets/avatars/cardano.png';
import doge from '../assets/avatars/doge.png';
import tron from '../assets/avatars/tron.png';
